DROP TABLE IF EXISTS `am_loan`;
CREATE TABLE `am_loan` (
  `acctNo` int(11) NOT NULL COMMENT '贷款账号',
  `idNo` varchar(18) NOT NULL COMMENT '身份证号',
  `contNo` int(11) NOT NULL COMMENT '贷款账号',
  `serviceCode` char(10) DEFAULT '' COMMENT '签约客服',
  `signSalesDepId` char(10) DEFAULT '' COMMENT '签约门店',
  `loanType` varchar(32) NOT NULL COMMENT '产品大类',
  `loanState` varchar(8) DEFAULT NULL COMMENT '借款状态',
  `rate` decimal(16,4) DEFAULT '0.0000' COMMENT '利率',
  `terms` int(11) DEFAULT NULL COMMENT '期数',
  `pactMoney` decimal(16,4) NOT NULL COMMENT '合同金额',
  `grantMoney` decimal(16,4) NOT NULL COMMENT '放款金额',
  `grantTime` datetime NOT NULL COMMENT '实际放款日期',
  `purpose` varchar(32) DEFAULT NULL COMMENT '贷款目的',
  `collectFlag` varchar(1) DEFAULT NULL COMMENT '案件类型， I 入催、O 出催',
  `signDate` varchar(8) DEFAULT NULL COMMENT '格式：yyyymmdd签约日期',
  `retuKind` varchar(4) DEFAULT NULL COMMENT '还款方式',
  `finishStatus` varchar(1) DEFAULT NULL COMMENT '结清标识， Y 结清、N 未结清',
  `remainPrincipal` decimal(16,4) DEFAULT NULL COMMENT '剩余本金',
  `remainInterest` decimal(16,4) DEFAULT NULL COMMENT '剩余利息',
  `overDueAmt` decimal(16,4) DEFAULT NULL COMMENT '逾期总额',
  `overDuePrincipal` decimal(16,4) DEFAULT NULL COMMENT '逾期本金',
  `overDueInterest` decimal(16,4) DEFAULT NULL COMMENT '逾期利息',
  `overDuePenalty` decimal(16,4) DEFAULT NULL COMMENT '逾期罚息',
  `overDueLiqui` decimal(16,4) DEFAULT NULL COMMENT '逾期违约金',
  `overDueDays` bigint(7) DEFAULT NULL COMMENT '逾期天数',
  `overDueDate` varchar(10) DEFAULT NULL COMMENT '逾期起始日',
  `storeProvince` varchar(6) DEFAULT '' COMMENT '门店所在省',
  `storeCity` varchar(6) DEFAULT '' COMMENT '门店所在市',
  `storeCounty` varchar(6) DEFAULT NULL COMMENT '门店所在县',
  `mark` varchar(6) DEFAULT '' COMMENT '金信，财富，p2p',
  `isTeleSale` varchar(1) DEFAULT '' COMMENT '是否电销',
  `remainPactMoney` decimal(16,4) DEFAULT NULL COMMENT '剩余合同金额',
  `repaidTerms` int(11) DEFAULT NULL COMMENT '已还期数',
  `remainTerms` int(11) DEFAULT NULL COMMENT '剩余期数',
  `isOverdue` varchar(1) DEFAULT NULL COMMENT '是否逾期',
  `paySubject` varchar(32) NOT NULL COMMENT '支付主体',
  `mgmtFee` decimal(16,4) DEFAULT NULL COMMENT '管理费',
  `overdueMgmtFee` decimal(16,4) DEFAULT NULL COMMENT '逾期管理费',
  `otherFee` decimal(16,4) DEFAULT NULL COMMENT '其他费用',
  `loanTimes` int(1) NOT NULL DEFAULT '0' COMMENT '贷款次数',
  `loanPurpose` varchar(32) DEFAULT NULL COMMENT '借款用途（现金借款或信用卡代偿）',
  `partnerUserId` int(11) NOT NULL COMMENT '业务用户ID',
  `rankLable` varchar(1) DEFAULT NULL COMMENT '等级标签',
  `mob` bigint(21) DEFAULT NULL COMMENT 'mob',
  `loanLabel` varchar(2) NOT NULL DEFAULT '' COMMENT '首贷贷中标签',
  `t0EarlyServiceFee` decimal(16,4) DEFAULT NULL COMMENT 't0期初服务费',
  `overDueT0EarlyServiceFee` decimal(16,4) DEFAULT NULL COMMENT '逾期T0期初服务费',
  `t0EarlyServiceFeeOverdueInterest` decimal(16,4) DEFAULT NULL COMMENT 't0期初服务费逾期罚息',
  `guaranteeDeposit` decimal(16,4) DEFAULT NULL COMMENT '保障金',
  `guaranteeDepositServiceFee` decimal(16,4) DEFAULT NULL COMMENT '保障金服务费',
  `overDueGuaranteeDeposit` decimal(16,4) DEFAULT NULL COMMENT '逾期保障金',
  `overDueGuaranteeDepositServiceFee` decimal(16,4) DEFAULT NULL COMMENT '逾期保障金服务费',
  `divisionMonthlyOverDueLevel` varchar(2) DEFAULT NULL COMMENT '分案月末逾期阶段',
  `isExistT0` varchar(4) DEFAULT NULL COMMENT '是否存在T0期',
  `t0OverdueDays` int(7) DEFAULT NULL COMMENT 'T0最大逾期天数',
  `t0DueDate` varchar(10) DEFAULT NULL COMMENT '最早逾期起T0应还款日',
  `t0OverdueAmount` decimal(16,4) DEFAULT NULL COMMENT 'T0逾期总金额',
  `billCollectionMode` varchar(1) DEFAULT NULL COMMENT '账单入催模式',
  `hasT0Overdue` varchar(1) DEFAULT NULL COMMENT '是否包含逾期T0',
  `t0Funder` varchar(32) NOT NULL COMMENT 'T0资金方',
  `overDueTerms` int(4) DEFAULT NULL COMMENT '逾期期数',
  `statementDate` varchar(64) DEFAULT NULL COMMENT '账单日',
  `pushSubject` varchar(20) DEFAULT NULL COMMENT '推标主体',
  `lendChannel` varchar(32) DEFAULT NULL COMMENT '进件渠道',
  `fundModel` varchar(32) DEFAULT NULL COMMENT '资金模式',
  `funder` varchar(32) DEFAULT NULL COMMENT '资金类型',
  `creditor` varchar(64) DEFAULT NULL COMMENT '债权人',
  `firstAdvanceDate` varchar(10) DEFAULT NULL COMMENT '首次垫付日期',
  `lastAdvanceDate` varchar(10) DEFAULT NULL COMMENT '末次垫付日期',
  `UpdateTime` datetime NOT NULL,
  PRIMARY KEY (`acctNo`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8;

