-- Table structure for `am_payment`
-- ----------------------------
DROP TABLE IF EXISTS `am_payment`;
CREATE TABLE `am_payment` (
  `acctNo` int(11) NOT NULL COMMENT '贷款编号',
  `id` int(11) NOT NULL COMMENT '交易流水ID',
  `planId` int(11) NOT NULL COMMENT '还款计划ID',
  `idNo` varchar(18) NOT NULL COMMENT '身份证号',
  `repayTime` date DEFAULT NULL COMMENT '还款时间',
  `retuKind` varchar(32) NOT NULL COMMENT '还款方式;COMMON_REPAY正常还款,OVERDUE_REPAY逾期还款,BAD_DEBT_REPAY坏账还款,IN_REPAY提前还款,DERATE_REPAY减免',
  `pmtAmt` decimal(16,4) NOT NULL DEFAULT '0.0000' COMMENT '还款金额',
  `repayTerm` int(11) NOT NULL COMMENT '还款期次',
  `repayPrincipal` decimal(16,4) NOT NULL DEFAULT '0.0000' COMMENT '还款本金',
  `repayInterest` decimal(16,4) NOT NULL DEFAULT '0.0000' COMMENT '还款利息',
  `penalty` decimal(16,4) NOT NULL DEFAULT '0.0000' COMMENT '罚息',
  `liqui` decimal(16,4) NOT NULL DEFAULT '0.0000' COMMENT '违约金',
  `dealDetail` decimal(16,4) NOT NULL DEFAULT '0.0000',
  `repayFee` decimal(16,4) NOT NULL DEFAULT '0.0000' COMMENT '还款服务费',
  `repayOther` decimal(16,4) NOT NULL DEFAULT '0.0000' COMMENT '还款其他费用',
  `repayManage` decimal(16,4) NOT NULL DEFAULT '0.0000' COMMENT '还款逾期管理费',
  `overDueDays` int(11) NOT NULL COMMENT '逾期天数',
  `functionCode` varchar(3) NOT NULL COMMENT '逾期阶段',
  `t0EarlyServiceFee` decimal(16,4) NOT NULL DEFAULT '0.0000' COMMENT 't0期初服务费',
  `t0EarlyServiceFeeOverdueInterest` decimal(16,4) NOT NULL DEFAULT '0.0000' COMMENT 't0期初服务费逾期罚息',
  `guaranteeDeposit` decimal(16,4) NOT NULL DEFAULT '0.0000' COMMENT '保障金',
  `guaranteeDepositServiceFee` decimal(16,4) NOT NULL DEFAULT '0.0000' COMMENT '保障金服务费',
  `funderOverdueInterest` decimal(16,4) NOT NULL DEFAULT '0.0000' COMMENT '资金方罚息',
  `UpdateTime` datetime DEFAULT NULL,
  PRIMARY KEY (`acctNo`,`planId`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8;

