DROP TABLE IF EXISTS `am_repaymentplan`;
CREATE TABLE `am_repaymentplan` (
  `acctNo` int(11) NOT NULL COMMENT '贷款编号',
  `planId` int(11) NOT NULL COMMENT '还款计划id',
  `pmtAmt` decimal(16,4) NOT NULL DEFAULT '0.0000' COMMENT '还款金额',
  `principal` decimal(16,4) NOT NULL DEFAULT '0.0000' COMMENT '本金',
  `interest` decimal(16,4) NOT NULL DEFAULT '0.0000' COMMENT '利息',
  `remainTotalAmt` decimal(16,4) NOT NULL DEFAULT '0.0000' COMMENT '剩余本金',
  `penalty` decimal(16,4) NOT NULL DEFAULT '0.0000' COMMENT '罚息',
  `liqui` decimal(16,4) NOT NULL DEFAULT '0.0000' COMMENT '违约金',
  `termNeedAmt` decimal(16,4) NOT NULL DEFAULT '0.0000' COMMENT '本期应还款额',
  `compenGold` decimal(16,4) DEFAULT '0.0000',
  `compenRecei` decimal(16,4) DEFAULT '0.0000',
  `amtAfterCompen` decimal(16,4) DEFAULT '0.0000',
  `actualRepayDate` date DEFAULT NULL COMMENT '实际还款日期',
  `isOverdue` varchar(2) NOT NULL COMMENT '是否逾期;Y逾期,N非逾期',
  `isPayPrincipal` varchar(2) NOT NULL COMMENT '是否已还本金;Y还清,N未还清',
  `dealDetail` varchar(32) DEFAULT NULL,
  `reliefInfo` varchar(32) DEFAULT NULL COMMENT '减免信息',
  `shouldTime` date NOT NULL COMMENT '还款日期',
  `terms` int(11) NOT NULL COMMENT '期数',
  `repaidCurrentAmt` decimal(16,4) NOT NULL DEFAULT '0.0000' COMMENT '当期期供已还金额',
  `remainCurrentAmt` decimal(16,4) NOT NULL DEFAULT '0.0000' COMMENT '当期期供未还',
  `earlyCurrentAmt` decimal(16,4) NOT NULL DEFAULT '0.0000' COMMENT '提前结清一次性还清金额',
  `shouldPenalty` decimal(16,4) NOT NULL DEFAULT '0.0000' COMMENT '应还罚息',
  `shouldLiqui` decimal(16,4) NOT NULL DEFAULT '0.0000' COMMENT '应还违约金',
  `shouldLatefee` decimal(16,4) NOT NULL DEFAULT '0.0000' COMMENT '应还滞纳金',
  `alsoPenalty` decimal(16,4) NOT NULL DEFAULT '0.0000' COMMENT '实还罚息',
  `alsoLiqui` decimal(16,4) NOT NULL DEFAULT '0.0000' COMMENT '实还违约金',
  `alsoLatefee` decimal(16,4) NOT NULL DEFAULT '0.0000' COMMENT '实还滞纳金',
  `breaksPenalty` decimal(16,4) NOT NULL DEFAULT '0.0000' COMMENT '减免罚息',
  `breaksLiqui` decimal(16,4) NOT NULL DEFAULT '0.0000' COMMENT '减免违约金',
  `breaksLatefee` decimal(16,4) NOT NULL DEFAULT '0.0000' COMMENT '减免滞纳金',
  `remainPenalty` decimal(16,4) NOT NULL DEFAULT '0.0000' COMMENT '未还罚息',
  `remainLiqui` decimal(16,4) NOT NULL DEFAULT '0.0000' COMMENT '未还违约金',
  `remainLatefee` decimal(16,4) NOT NULL DEFAULT '0.0000' COMMENT '未还滞纳金',
  `currentOverDueDays` int(11) NOT NULL DEFAULT '0' COMMENT '当期逾期天数',
  `tremStatus` varchar(32) NOT NULL COMMENT '期供状态;UNREPAID待还款,PART_REPAID部分还款,PAYOFF已还清,OVERDUE逾期',
  `tremServicesCharge` varchar(16) DEFAULT '0.0000' COMMENT '分期服务费',
  `payoffTime` varchar(64) DEFAULT NULL COMMENT '结清时间',
  `repayType` varchar(32) NOT NULL COMMENT '结清方式;COMMON_REPAY正常还款,OVERDUE_REPAY逾期还款,BAD_DEBT_REPAY坏账还款,IN_REPAY提前还款,DERATE_REPAY减免',
  `mgmtFee` decimal(16,4) NOT NULL DEFAULT '0.0000' COMMENT '服务费',
  `leftPrincipal` decimal(16,4) NOT NULL DEFAULT '0.0000' COMMENT '剩余未还本金',
  `leftInterest` decimal(16,4) NOT NULL DEFAULT '0.0000' COMMENT '剩余未还利息',
  `repaidPrincipal` decimal(16,4) NOT NULL DEFAULT '0.0000' COMMENT '实还本金',
  `repaidInterest` decimal(16,4) NOT NULL DEFAULT '0.0000' COMMENT '实还利息',
  `repaidMgmtFee` decimal(16,4) NOT NULL DEFAULT '0.0000' COMMENT '实还管理费',
  `t0EarlyServiceFee` decimal(16,4) NOT NULL DEFAULT '0.0000' COMMENT 't0期初服务费',
  `t0EarlyServiceFeeOverdueInterest` decimal(16,4) NOT NULL DEFAULT '0.0000' COMMENT 't0期初服务费逾期罚息',
  `leftT0EarlyServiceFee` decimal(16,4) NOT NULL DEFAULT '0.0000' COMMENT '剩余未还T0期初服务费',
  `leftT0EarlyServiceFeeOverdueInterest` decimal(16,4) NOT NULL DEFAULT '0.0000' COMMENT '剩余未还T0期初服务费逾期罚息',
  `breaksT0EarlyServiceFee` decimal(16,4) NOT NULL DEFAULT '0.0000' COMMENT '减免T0期初服务费',
  `breaksT0EarlyServiceFeeOverdueInterest` decimal(16,4) NOT NULL DEFAULT '0.0000' COMMENT '减免T0期初服务费逾期罚息',
  `guaranteeDeposit` decimal(16,4) NOT NULL DEFAULT '0.0000' COMMENT '保障金',
  `guaranteeDepositServiceFee` decimal(16,4) NOT NULL DEFAULT '0.0000' COMMENT '保障金服务费',
  `leftGuaranteeDeposit` decimal(16,4) NOT NULL DEFAULT '0.0000' COMMENT '剩余未还保障金',
  `leftGuaranteeDepositServiceFee` decimal(16,4) NOT NULL DEFAULT '0.0000' COMMENT '剩余未还保障金服务费',
  `breaksGuaranteeDeposit` decimal(16,4) NOT NULL DEFAULT '0.0000' COMMENT '减免保障金',
  `breaksGuaranteeDepositServiceFee` decimal(16,4) NOT NULL DEFAULT '0.0000' COMMENT '减免保障金服务费',
  `funderOverdueInterest` decimal(16,4) NOT NULL DEFAULT '0.0000' COMMENT '资金方罚息',
  `leftFunderOverdueInterest` decimal(16,4) NOT NULL DEFAULT '0.0000' COMMENT '剩余未还资金方罚息',
  `breaksFunderOverdueInterest` decimal(16,4) NOT NULL DEFAULT '0.0000' COMMENT '减免资金方罚息',
  `UpdateTime` datetime DEFAULT NULL,
  PRIMARY KEY (`acctNo`,`planId`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8;

