  `reportdate` date DEFAULT NULL COMMENT '报表日期',
  `month` varchar(32) DEFAULT NULL COMMENT '月份',
  `area` varchar(32) DEFAULT NULL COMMENT '大区',
  `district` varchar(32) DEFAULT NULL COMMENT '区域',
  `branchid` int(11) DEFAULT NULL COMMENT '所属门店id',
  `branchname` varchar(32) DEFAULT NULL COMMENT '所属门店',
  `mob` int(11) DEFAULT NULL COMMENT 'mob',
  `seller_name` varchar(32) NOT NULL COMMENT '员工姓名',
  `seller_id` varchar(32) NOT NULL COMMENT '员工编号',
  `position` varchar(32) DEFAULT NULL COMMENT '员工职位',
  `last_in_date` date DEFAULT NULL COMMENT '任岗时间',
  `leave_date` varchar(10) DEFAULT NULL COMMENT '离岗时间',
  `on_rate` decimal(16,4) DEFAULT NULL COMMENT '绩效切分比例',
  `old_position` varchar(50) DEFAULT NULL COMMENT '最近一次异动岗位',
  `is_protect` int(1) DEFAULT NULL COMMENT '是否处于适应期',
  `branch_parameter` decimal(16,6) DEFAULT NULL COMMENT ' 机构系数',
  `actual_parameter` decimal(16,6) DEFAULT NULL COMMENT '最终系数',
  `month_preformance_base` decimal(16,6) DEFAULT NULL COMMENT ' 月度绩效基数',
  `balanced_preformance_base` decimal(16,6) DEFAULT NULL COMMENT '调整后月度绩效基数',
  `actual_preformance_base_last` decimal(16,6) DEFAULT NULL COMMENT '最终绩效',
  `is_check` int(1) DEFAULT NULL COMMENT '是否处于考核保护期',
  `is_out` int(1) DEFAULT NULL COMMENT '是否考核淘汰',
  `total_score` int(10) DEFAULT NULL COMMENT '总得分'
) ENGINE=InnoDB DEFAULT CHARSET=utf8;

